package colorweaver;

import java.nio.charset.StandardCharsets;

/**
 * Provides access to precalculated tiling planes of 2D blue noise, that is, noise without high-frequency components,
 * as well as seeded mixes of different blue noise planes that make it have even fewer patterns. This doesn't
 * produce continuous noise such as Perlin or Simplex noise, instead producing noise in the signal-to-noise sense. The
 * blue-noise distribution has the practical effect that a value only appears next to a similar value very rarely. For a
 * quick introduction, see <a href="https://blog.demofox.org/2018/01/30/what-the-heck-is-blue-noise/">Alan Wolfe's
 * blog</a>, which has many more useful posts and links that often relate to blue noise and its relatives, like
 * low-discrepancy sequences (also called quasi-random sequences, QRNGs, or sub-random sequences).
 * <br>
 * This uses 64 128x128 triangular-mapped blue noise textures generated by
 * <a href="https://github.com/yellowstonegames/SquidSquad/blob/0d363521aea2f27556f7fd4205bbb7ffba0e8111/squidworld/src/test/java/com/github/yellowstonegames/world/BlueNoiseEqualOmniTilingGenerator.java">a "test" in SquidSquad</a>, using code adapted from Bart Wronski's
 * <a href="https://bartwronski.com/2021/04/21/superfast-void-and-cluster-blue-noise-in-python-numpy-jax/">Colab
 * notebook in Python</a>. The big contribution here is that all the textures generated can seamlessly tile with each
 * other, as if they were meant to tile with the other tile, for any of the 64 tiles. I call this "omni-tiling" because
 * unlike a Wang tiling, which only permits half or fewer of tiles to match a particular edge, all the tiles can
 * appear to be seamless when laid out in a grid, even when randomly selected. Normally, just placing blue noise
 * textures next to each other produces clear seams or "breaks" in the blue noise, so this is a nice thing to have.
 * <br>
 * Big thanks to Bart Wronski for making Ulichney's Void and Cluster algorithm accessible to me, and Alan Wolfe for
 * helping me understand how useful blue noise is in the first place!
 */
